import React from "react";
import "./index.scss";

import ChartSolides from "../../../../../components/charts";
import List from "./list";

const Skills = ({ data }) => {
    return (
        <div className="skills-noAuth">
            <h2>CompetÃªncias</h2>
            <div className="box-results">
                <div className="box-left">
                    <ChartSolides
                        type="competences"
                        talents={{
                            data1: data.tolerancia,
                            data2: data.planejamento,
                            data3: data.empatia,
                            data4: data.capac_ouvir,
                            data5: data.concentracao,
                            data6: data.condescendencia,
                            data7: data.perfil_tecnico,
                            data8: data.organizacao,
                            data9: data.detalhismo,
                            data10: data.rigorosidade,
                            data11: data.orientadorsultado,
                            data12: data.multitarefas,
                            data13: data.automotivacao,
                            data14: data.proatividade,
                            data15: data.dinamismo,
                            data16: data.dominancia,
                            data17: data.extroversao,
                            data18: data.relac_interpes,
                            data19: data.sociabilidade,
                            data20: data.orientadorelacionamento
                        }}
                    />
                </div>
                <div className="box-right">
                    <List />
                </div>
            </div>
        </div>
    );
};

export default Skills;
